export const en = {
  theme: {
    toggle: 'Toggle Theme',
    light: 'Light',
    dark: 'Dark'
  },
  language: {
    toggle: 'Switch Language',
    chinese: '中文',
    english: 'English'
  },
  app: {
    title: 'Hello kaka',
    version: 'Version: 0.1.0',
    description: 'A simple React demo project for showcasing basic features'
  }
};
